Below is a concise, up-to-date setup flow aligned with Apple’s iOS 16.4+ “Home Screen web app” Web Push behavior and the current (2025) standards docs.

**What Apple supports on iOS 16.4+**
- Web Push works only for web apps added to the Home Screen (not for normal Safari tabs). The app must open as a Home Screen web app, which requires a Web App Manifest with `display` set to `standalone` or `fullscreen`. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Web Push is standards-based: Push API + Notifications API + Service Workers. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Permission prompts must be triggered by a direct user gesture (e.g., a “Subscribe” button). ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Apple’s implementation uses APNs, but you do **not** need an Apple Developer Program account; allow `*.push.apple.com` if your server restricts outbound endpoints. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  

---

**Step 1: Add a Web App Manifest and link it**
`manifest.webmanifest` (or `manifest.json`), at a stable URL:

```json
{
  "name": "Example App",
  "short_name": "Example",
  "start_url": "/",
  "display": "standalone",
  "icons": [
    { "src": "/icons/icon-192.png", "sizes": "192x192", "type": "image/png" },
    { "src": "/icons/icon-512.png", "sizes": "512x512", "type": "image/png" }
  ]
}
```

Link it in HTML:

```html
<link rel="manifest" href="/manifest.webmanifest">
```

The manifest format is standardized by the Web App Manifest spec. ([w3.org](https://www.w3.org/TR/appmanifest/?utm_source=openai))  
The `display: "standalone"` (or `fullscreen`) requirement for Home Screen web apps on iOS is from WebKit’s iOS 16.4 guidance. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))

---

**Step 2: Register a service worker**
```js
// app.js
if ("serviceWorker" in navigator) {
  await navigator.serviceWorker.register("/sw.js");
}
```

Service Workers are the required background event target for Push. ([w3.org](https://www.w3.org/TR/service-workers/?utm_source=openai))  

---

**Step 3: Ask permission + subscribe (must be user-initiated)**
```js
// app.js
const subscribeBtn = document.querySelector("#subscribe");

subscribeBtn.addEventListener("click", async () => {
  const permission = await Notification.requestPermission();
  if (permission !== "granted") return;

  const reg = await navigator.serviceWorker.ready;
  const sub = await reg.pushManager.subscribe({
    userVisibleOnly: true,
    applicationServerKey: VAPID_PUBLIC_KEY
  });

  // Send `sub` to your server
  await fetch("/api/push/subscribe", {
    method: "POST",
    headers: {"Content-Type": "application/json"},
    body: JSON.stringify(sub)
  });
});
```

- `Notification.requestPermission()` is defined by the Notifications API. ([notifications.spec.whatwg.org](https://notifications.spec.whatwg.org/?utm_source=openai))  
- `pushManager.subscribe(...)` is defined by the Push API and delivers pushes to the service worker. ([w3.org](https://www.w3.org/TR/push-api/?utm_source=openai))  
- On iOS 16.4, the permission prompt must be triggered by a user gesture. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))

---

**Step 4: Handle pushes and show notifications in the service worker**
```js
// sw.js
self.addEventListener("push", (event) => {
  const data = event.data?.json() || {};
  const title = data.title || "New update";
  const options = {
    body: data.body || "",
    icon: "/icons/icon-192.png",
    badge: "/icons/icon-192.png",
    data: { url: data.url || "/" }
  };

  event.waitUntil(self.registration.showNotification(title, options));
});

self.addEventListener("notificationclick", (event) => {
  event.notification.close();
  const url = event.notification.data?.url || "/";
  event.waitUntil(clients.openWindow(url));
});
```

Push events are delivered to the service worker, and notifications are shown via the Notifications API. ([w3.org](https://www.w3.org/TR/push-api/?utm_source=openai))  

---

**Step 5: Send pushes from your server**
- Store each subscription object server-side.  
- Use the Web Push protocol (with VAPID keys) to send to the subscription’s `endpoint`. The Push API spec defines this model and references the web push protocol used by push services (including Apple’s APNs-backed service on iOS). ([w3.org](https://www.w3.org/TR/push-api/?utm_source=openai))  

---

**Quick iOS 16.4+ checklist**
- Home Screen web app (Add to Home Screen). ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Manifest present with `display: "standalone"` or `fullscreen`. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Service worker registered. ([w3.org](https://www.w3.org/TR/service-workers/?utm_source=openai))  
- Permission prompt triggered by user action. ([webkit.org](https://webkit.org/blog/13878/web-push-for-web-apps-on-ios-and-ipados/?utm_source=openai))  
- Push subscription created via Push API and notifications shown via Notifications API. ([w3.org](https://www.w3.org/TR/push-api/?utm_source=openai))  

If you want, tell me your stack (framework + push server library) and I can give you exact code for generating VAPID keys and sending Web Push to Apple/Safari subscriptions.

